// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "./OriToken.sol";
import "./TangibleStakeToken.sol";

// HNK Orijent 1919 - $ORI - Shared Invest Contract
// This Contract is Investment Model 1
contract OriShare {

	// reference to deployed $OIR contract
	OriToken internal _ori;

	// Owner of the contract (for admin controls)
	address private owner;

	// contract was terminated and can't be used anymore
	bool private terminated = false;

	// initialized
	bool private initialized = false;

	// Shares contributed to the tangible
	uint constant tangibleTax = 10;
	uint constant contributionFactor = 2;

	// Address of the tangible
	address private tangibleAddress;

	// Total balance (locked in $ORI)
	uint256 private balance = 0;
	// Virtual balance
	uint256 private virtualBalance = 0;

	// Stakes
	mapping (address => uint256) private shares;
	address[] private shareholders;

	// Set owner and DI OriToken
	constructor(address oriTokenAddress) {
		owner = _msgSender();
		_ori = OriToken(oriTokenAddress);
	}

	// ----------------------------------------------------------------------------------------------------------
	// ----------------------------------------------- MODIFIERS ------------------------------------------------
	// ----------------------------------------------------------------------------------------------------------

	/**
    *  Verify tangible is active and initialized
    *
    */
	modifier _isActive() {
		require(initialized, 'Tangible was not initialized');
		require(!terminated, 'Tangible was terminated');
		_;
	}

	// ----------------------------------------------------------------------------------------------------------
	// ------------------------------------------------ INTERNAL ------------------------------------------------
	// ----------------------------------------------------------------------------------------------------------

	// Safe access to msg.sender
	function _msgSender() internal view virtual returns (address) {
		return msg.sender;
	}

	// ----------------------------------------------------------------------------------------------------------
	// ------------------------------------------------- PUBLIC -------------------------------------------------
	// ----------------------------------------------------------------------------------------------------------

	function initalize() public returns (bool){
		require(!initialized, 'Tangible already initialized');
		require(tangibleAddress != address(0), 'Please set tangible address first');
		require(owner == _msgSender(), 'Only owner can initalize tangibles');

		// start bidding
		initialized = true;

		return true;
	}

	// Set the tangible address (for emergency, if player wallet spoofed)
	function setTangible(address _tangibleAddress) public returns (bool) {
		require(owner == msg.sender, 'Only owner can set Tangible');

		tangibleAddress = _tangibleAddress;
		return true;
	}


	// Purchase
	function purchase(uint256 amount) public _isActive() returns (uint256){
		require(amount > 1000000, 'Invalid amount provided');

		// check if enough escrow allowed
		require(_ori.allowance(_msgSender(), address(this)) >= amount, 'Insufficient allowance provided');

		// tax
		uint256 tax = (amount * tangibleTax) / 100;
		uint256 contribution = tax / 2;
		uint256 invest = amount - tax;

		// invest in factor to real balance
		uint256 vInvest = invest;

		if (balance != 0){
			uint256 investorShare = (invest * 1000000) / (balance + amount - contribution);
			vInvest = (investorShare * virtualBalance) / (1000000 - investorShare);
		}

		// add to real balance
		balance += amount - contribution;
		virtualBalance += vInvest;

		// assign balance
		if (shares[_msgSender()] == 0){
			shares[_msgSender()] = vInvest;
			shareholders.push(_msgSender());
		} else {
			shares[_msgSender()] += vInvest;
		}

		// pull escrow
		_ori.transferFrom(_msgSender(), address(this), amount);

		// pay tangible
		_ori.transfer(tangibleAddress, contribution);

		return vInvest;
	}

	// claim
	function claim() public _isActive() returns (uint256){
		require(shares[_msgSender()] > 0, 'No shares');

		// remove stakes balance
		uint256 _balance = balanceOf(_msgSender());
		virtualBalance -= shares[_msgSender()];
		balance -= _balance;

		// transfer
		_ori.transfer(_msgSender(), _balance);

		// remove share
		shares[_msgSender()] = 0;

		// remove shareholder index
		uint256 index = 0;
		for(uint256 i=0;i<shareholders.length;i++){
			if (shareholders[i] == _msgSender())
				index = i;
		}
		shareholders[index] = shareholders[shareholders.length-1];
		shareholders.pop();

		return _balance;
	}

	// Used to add value to tangible
	function disburse(uint256 amount) public _isActive() returns (bool){
		require(amount > 0, 'Invalid amount provided');

		// check if enough escrow allowed
		require(_ori.allowance(_msgSender(), address(this)) >= amount, 'Insufficient allowance provided');

		// pull escrow
		_ori.transferFrom(_msgSender(), address(this), amount);
		balance += amount;

		return true;
	}

	// Terminate this contract, and pay-out all remaining investors
	function terminate() public _isActive() returns (bool) {
		require(owner == msg.sender, 'Only owner can terminate');
		terminated = true;
		return true;
	}

	// Get shares of one investor
	function sharesOf(address _owner) public view returns (uint256) {
		return shares[_owner] * 100000 / virtualBalance;
	}

	// Get shares of one investor
	function virtualSharesOf(address _owner) public view returns (uint256) {
		return shares[_owner];
	}

	function balanceOf(address _owner) public view returns (uint256) {
		return sharesOf(_owner) * balance / 100000;
	}

	// Get total balance of locked $ORI
	function getBalance() public view returns (uint256) {
		return balance;
	}
	function getVirtualBalance() public view returns (uint256) {
		return virtualBalance;
	}

	// Return current price
	function getPrice() public view returns (uint256) {
		return balance / 100;
	}

	// Get shareholder addresses
	function getShareholders() public view returns (address[] memory) {
		return shareholders;
	}

}
